// вывод списка товара с помощью ассоциативного массива

var users = {
    "user-1" : {
        "name" : "Вася Пупкин",
        "img" : "data:image/jpeg;base64,\"",
        "likes" : "1654"
    },
    "user-2" : {
        "name" : "Роберто Хулиоc",
        "img" : "data:image/jpeg;base64,",
        "likes" : "456"
    },
    "user-3" : {
        "name" : "Местный бомж Жэка",
        "img" : "data:image/jpeg;base64,",
        "likes" : "0"
    }
};

/* Создаём блок отображения юзеров */
var out ='';
for (var key in users){
    out += '<div class="user-block">';
    out += '<h2>' + users[key].name + '</h2>';
    out += '<img src="' + users[key].img +'">';
    out += '<p class="like"><a href="#">Like! <i class="far fa-thumbs-up"></i></a> ' + users[key].likes + ' <i class="fas fa-user-alt"></i></p>';
    out += '</div>';
}
document.getElementById('outUsers').innerHTML = out;

/* thank you */
var like = document.querySelectorAll('.like');

for (i = 0; i < like.length; i++) {
    like[i].addEventListener('click', function() {
        this.innerHTML = 'Ваш голос принят!'
    });
}
